import '../../assets/styles/header.css'
import Particles from "react-tsparticles";

function Header() {
    return (
        <div>
            <Particles id="tsparticles" url="http://foo.bar/particles.json" init={particlesInit} loaded={particlesLoaded} />
            <header>
                Publish your ideas
            </header>
        </div>

    );
}

export default Header;
